    false,nt"url": null,nt"notes": "This is a survey of the amphibians and
    reptiles of two Quitman Couny, Mississippi US. Fish and Wildlife Refuges designated
    as FSA Starr 750 and Starr 320. The field studies began on 28 March 2003 prior to
    funding and terminated on 8 June 2004. The survey located two salamander, eight
    frog and toad, 10turtle, three lizard, and 11 snake species within the refuge boundaries.
    No federal or state threatened or endangered species were found within the refuges.
    Voucher specimens were collected for the amphibian and reptilian species and these
    will eventually be housed as federal specimens at the Mississippi Museum of Natural
    Science in Jackson, Mississippi. Brief comments are offered on mammalian species
    observed incidental to the herpetofaunal survey.",nt"license_title": "License
